import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import NavbarIn from "./navbar/NavbarIn";

class Profile extends Component {
  constructor(props) {
    super();
    this.state = {};
  }

  render() {
    return (
      <div>
        <NavbarIn />
        <br />
        <br />
        <br />
        <h1 className="tc white i grow f1 font">My Profile</h1>
        <br />
        <br />
        <Container className='tc f3 solidBR'>
          <Row>
            <Col className="pa5">
              <u><i>My Persinal Infomation</i></u>
              <a href="/"></a>
            </Col>
            <Col className="pa5">
              <u><i>My Betting History</i></u>
            </Col>
          </Row>
          <Row>
            <Col className="pa5">
              <u><i>Finacial Transactions</i></u>
            </Col>
            <Col className="pa5">
              <u><i>Finacial Transactions</i></u>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Profile;
